import React from 'react';
import Svg, { Path } from 'react-native-svg';
import { View } from 'react-native';

const OctahedronSvg = (props) => {
  return (
    <View style={{ 
      width: 300, 
      height: 326,
      backgroundColor: 'transparent',  // Debug background
      alignItems: 'center',
      justifyContent: 'center',
    }}>
      <Svg 
        width={300} 
        height={326} 
        viewBox="0 0 300 326" 
        fill="none" 
        style={{
          transform: [{scale: 1}],  // Ensure proper scaling
        }}
        {...props}
      >
        <Path d="M150 40L80 200L150 280L220 200L150 40Z" fill="#2C1A0B" stroke="#F4E409" strokeWidth="4"/>
        <Path d="M150 40L80 200L50 160L150 40Z" fill="#A3930A" stroke="#F4E409" strokeWidth="4"/>
        <Path d="M150 40L220 200L250 160L150 40Z" fill="#827511" stroke="#F4E409" strokeWidth="4"/>
        <Path d="M80 200L150 280L220 200L250 160L50 160L80 200Z" fill="#1A1205" stroke="#F4E409" strokeWidth="4"/>
      </Svg>
    </View>
  );
};

export default OctahedronSvg;
